        /**
         * <p>Retrieves a resource bundle for the given library and locale.</p><p>If only one argument is given, it is assumed to be the libraryName. The locale then falls back to the current <a class="jsdoclink scrollToMethod" target="_self" href="#/api/sap.ui.core.Configuration/methods/getLanguage" data-sap-ui-target="sap.ui.core.Configuration/methods/getLanguage">session locale</a>. If no argument is given, the library also falls back to a default: "sap.ui.core".</p><h3>Configuration via App Descriptor</h3><p> When the App Descriptor for the library is available without further request (manifest.json has been preloaded) and when the App Descriptor is at least of version 1.9.0 or higher, then this method will evaluate the App Descriptor entry <code>"sap.ui5" / "library" / "i18n"</code>. <ul> <li>When the entry is <code>true</code>, a bundle with the default name "messagebundle.properties" will be loaded</li> <li>If it is a string, then that string will be used as name of the bundle</li> <li>If it is <code>false</code>, no bundle will be loaded and the result will be <code>undefined</code></li> </ul></p><h3>Caching</h3><p> Once a resource bundle for a library has been loaded, it will be cached by this method. Further calls for the same library and locale won't create new requests, but return the already loaded bundle. There's therefore no need for control code to cache the returned bundle for a longer period of time. Not further caching the result also prevents stale texts after a locale change.</p><h3>Asynchronous Loading</h3><p> The asynchronous variant of <a class="jsdoclink scrollToMethod" target="_self" href="#/api/sap.ui.core.Core/methods/loadLibrary" data-sap-ui-target="loadLibrary">#loadLibrary</a> will evaluate the same descriptor entry as described above. If it is not <code>false</code>, loading the main resource bundle of the library will become a subtask of the asynchronous loading of the library.</p><p>Due to this preload of the main bundle and the caching behavior of this method, controls in such a library still can use the synchronous variant of <code>getLibraryResourceBundle</code> in their API, behavior and rendering code. Only when the bundle is needed at module execution time (by top level code in a control module), then the asynchronous variant of this method should be preferred.</p>
         * @param {string} sLibraryName <p>Name of the library to retrieve the bundle for</p>
         * @param {string} sLocale <p>Locale to retrieve the resource bundle for</p>
         * @param {boolean} bAsync <p>Whether the resource bundle is loaded asynchronously</p>
         * @returns any <p>The best matching resource bundle for the given parameters or <code>undefined</code>; in asynchronous case a Promise on that bundle is returned</p>
         */
        getLibraryResourceBundle(sLibraryName?: string, sLocale?: string, bAsync?: boolean): any | Promise<any>;
        /**
         * <p>Returns a map of library info objects for all currently loaded libraries, keyed by their names.</p><p>The structure of the library info objects matches the structure of the info object that the <a class="jsdoclink scrollToMethod" target="_self" href="#/api/sap.ui.core.Core/methods/initLibrary" data-sap-ui-target="initLibrary">#initLibrary</a> method expects. Only property names documented with <code>initLibrary</code> should be accessed, any additional properties might change or disappear in future. When a property does not exists, its default value (as documented with <code>initLibrary</code>) should be assumed.</p><p><b>Note:</b> The returned info objects must not be modified. They might be a living copy of the internal data (for efficiency reasons) and the framework is not prepared to handle modifications to these objects.</p>
         * @returns { [key: string]: any } <p>Map of library info objects keyed by the library names.</p>
         */
