        includeLibraryTheme(sLibName: string, sVariant?: string, sQuery?: string): void;
        /**
         * <p>Provides the framework with information about a library.</p><p>This method is intended to be called exactly once while the main module of a library (its <code>library.js</code> module) is executing, typically at its begin. The single parameter <code>oLibInfo</code> is an info object that describes the content of the library.</p><p>When the <code>oLibInfo</code> has been processed, a normalized version of it will be kept and will be returned as library information in later calls to <a class="jsdoclink scrollToMethod" target="_self" href="#/api/sap.ui.core.Core/methods/getLoadedLibraries" data-sap-ui-target="getLoadedLibraries">#getLoadedLibraries</a>. Finally, <code>initLibrary</code> fires (the currently private) <a class="jsdoclink scrollToEvent" target="_self" href="#/api/sap.ui.core.Core/events/LibraryChanged" data-sap-ui-target="sap.ui.core.Core/events/LibraryChanged">#event:LibraryChanged</a> event with operation 'add' for the newly loaded library.</p><h3>Side Effects</h3><p>While analyzing the <code>oLibInfo</code>, the framework takes some additional actions:</p><p><ul> <li>If the info object contains a list of <code>interfaces</code>, they will be registered with the <a class="jsdoclink scrollToMethod" target="_self" href="#/api/sap.ui.base.DataType" data-sap-ui-target="DataType">sap.ui.base.DataType</a> class to make them available as aggregation types in managed objects.</li></p><p><li>If the object contains a list of <code>controls</code> or <code>elements</code>, <a class="jsdoclink scrollToMethod" target="_self" href="#/api/sap.ui.lazyRequire" data-sap-ui-target="lazyRequire">lazy stubs</a> will be created for their constructor as well as for their static <code>extend</code> and <code>getMetadata</code> methods.<br> <b>Note:</b> Future versions might abandon the concept of lazy stubs as it requires synchronous XMLHttpRequests which have been deprecated (see <a target="blank" href="http://xhr.spec.whatwg.org">http://xhr.spec.whatwg.org</a>
        <img src="./resources/sap/ui/documentation/sdk/images/link-external.png" 
        title="Information published on non SAP site" class="sapUISDKExternalLink"/>). To be on the safe side, productive applications should always require any modules that they directly depend on.</li></p><p><li>With the <code>noLibraryCSS</code> property, the library can be marked as 'theming-free'. Otherwise, the framework will add a &lt;link&gt; tag to the page's head, pointing to the library's theme-specific stylesheet. The creation of such a &lt;link&gt; tag can be suppressed with the <a class="jsdoclink scrollToMethod" target="_self" href="#/api/sap.ui.core.Configuration" data-sap-ui-target="Configuration">global configuration option</a> <code>preloadLibCss</code>. It can contain a list of library names for which no stylesheet should be included. This is e.g. useful when an application merges the CSS for multiple libraries and already loaded the resulting stylesheet.</li></p><p><li>If a list of library <code>dependencies</code> is specified in the info object, those libraries will be loaded synchronously by <code>initLibrary</code>.<br> <b>Note:</b> Dependencies between libraries don't have to be modeled as AMD dependencies. Only when enums or types from an additional library are used in the coding of the <code>library.js</code> module, the library should be additionally listed in the AMD dependencies.</li> </ul></p><p>Last but not least, higher layer frameworks might want to include their own metadata for libraries. The property <code>extensions</code> might contain such additional metadata. Its structure is not defined by the framework, but it is strongly suggested that each extension only occupies a single property in the <code>extensions</code> object and that the name of that property contains some namespace information (e.g. library name that introduces the feature) to avoid conflicts with other extensions. The framework won't touch the content of <code>extensions</code> but will make it available in the library info objects returned by <a class="jsdoclink scrollToMethod" target="_self" href="#/api/sap.ui.core.Core/methods/getLoadedLibraries" data-sap-ui-target="getLoadedLibraries">#getLoadedLibraries</a>.</p><h3>Relationship to Descriptor for Libraries (manifest.json)</h3><p>The information contained in <code>oLibInfo</code> is partially redundant to the content of the descriptor for the same library (its <code>manifest.json</code> file). Future versions of UI5 might ignore the information provided in <code>oLibInfo</code> and might evaluate the descriptor file instead. Library developers therefore should keep the information in both files in sync.</p><p>When the <code>manifest.json</code> is generated from the <code>.library</code> file (which is the default for UI5 libraries built with Maven), then the content of the <code>.library</code> and <code>library.js</code> files must be kept in sync.</p>
         * @param {any} oLibInfo <p>Info object for the library</p>
         */
        initLibrary(oLibInfo: any): void;
